import L from 'leaflet';

const iconPerso = new L.Icon({
    iconUrl: require('./images/train.png'),
    iconRetinaUrl: require('./images/train.png'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(60, 75),
});

export { iconPerso };
